 New&quot;, monospace; background-color: rgb(245, 245, 245);">And it&#39;s not because I&#39;m lonely, and it&#39;s not because it&#39;s New Year&#39;s Eve.</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">I came here tonight because when you realize you want to spend the rest of your life with somebody,</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">you want the rest of your life to start as soon as possible.</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">Sally：You see！That is just like you, Harry. You say things like that and you make it impossible for me to hate you！</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">And I hate you，Harry. I really hate you. I hate you.</span></p>', 1490524625, 1490528841),
	(3, 69, '<p><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">Sally Albright: How do you expect me to respond to this?</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">Harry Burns: How about you love me too.</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">Sally Albright: How about I&#39;m leaving.</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">Harry: Doesn&#39;t what I said mean anything to you?</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">Sally: I&#39;m sorry Harry, I know it&#39;s New Years Eve. I know you&#39;re feeling lonely, but you just can&#39;t show up here,</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">tell me you love me and expect that to make everything alright. It doesn&#39;t work this way.</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">Harry: Well how does it <strong>work</strong>?</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">Sally: I don&#39;t know but not in this way.</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">Harry Burns: Well how about this way. I love that you get cold when it&#39;s 71 degrees out.</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">I love that it takes you an hour and a half to order a sandwich.</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">I love that you get a little crinkle above your nose when you&#39;re looking at me like I&#39;m nuts.</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">I love that after I spend the <strong>day</strong> with you, I can still smell your perfume on my clothes.</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">And I love that you are the last person I want to talk to before I go to sleep at night.</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">And it&#39;s not because I&#39;m lonely, and it&#39;s not because it&#39;s New Year&#39;s Eve.</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">I came here tonight because when you realize you want to spend the rest of your life with somebody,</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">you want the rest of your life to start as soon as possible.</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">Sally：You see！That is just like you, Harry. You say things like that and you make it impossible for me to hate you！</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">And I hate you，Harry. I really hate you. I hate you.</span></p>', '<p><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">Sally Albright: How do you expect me to respond to this?</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">Harry Burns: How about you love me too.</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; background-color: rgb(245, 245, 245);">Sally Albright: How about I&#39;m leaving.</span><br style="box-sizing: border-box; color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; white-space: normal;"/><span style="color: rgb(51, 51, 51); font-family: 